import http from 'src/utils/http'

const URL = 'purchases'

const purchaseAPI = {
  addToCart(data) {
    return http.post(`${URL}/add-to-cart`, data)
  },
  getProductPurchases(status) {
    return http.get(`${URL}?status=${status}`)
  }
}

export default purchaseAPI
